text:
{"name": "Popis", "value": "Nabízíme k pronájmu samostatný zařízený pokoj o celkové rozloze 11m2, který se nachází v 1. patře studentské rezidence na náměstí Kinských, Praha 5. Dům prošel kompletní rekonstrukcí roku 2019. Pokoj je kompletně zařízený moderním nábytkem a je uzamykatelný. V bytě je celkem 5 pokojů, které mají společnou kuchyň s jídelním koutem, dvě koupelny se sprchovým koutem a další toaletu. Byt je plně vybavený včetně žehličky, prkna, a vybavení na úklid. Úklid společných prostor je již zahrnut v ceně nájmu, a to jednou týdně. Vysokorychlostní internet v ceně poplatků. Dále je také k dispozici zcela zdarma fitness, prádelna s pračkami a sušičkami (na mince) a společná terasa.

Rezidence se nachází ve velice oblíbené lokalitě přímo v centru města a v těsné blízkosti zahrady ,,Kinských" a parku ,,Petřín". Výborná občanská vybavenost : obchodní centrum Anděl, Cinema City Nový Smíchov, školy, restaurace , bary a mnoho dalšího v okolí. Výborné dopravní spojení: před domem je tramvajová zastávka ,, Švandova divadlo", 10min chůze stanice metra Anděl nebo pět zastávek tram. na vlakové nádraží ,,Praha – Smíchov".

Vhodné především pro studenty pro střednědobý pronájem. Pokoj je možné pronajmout i od 1.9.2025. Pro více informací kontaktujte makléře."}

{"name": "Popis", "value": "Nabízíme k pronájmu luxusní byt 3+1, který se nachází v prvním patře cihlového domu s výtahem na Novém Městě v ulici Odborů.

Byt je prostorný, jeho celková užitná plocha je 80 m2. Byt disponuje obývacím pokojem s jídelní částí, odděleným plně vybaveným kuchyňský koutem (digestoř, sporák, pečící trouba, mikrovlnná trouba, myčka, lednice),  2 samostatnémi ložnicemi s vestavěnými skříněmi, 2 koupelny (vana, toaleta bidet a sprchový kout, toaleta, bidet) a šatna. Je kompletně zařízen moderním nábytkem. Na podlahách jsou parkety a dlažba.  Je zde možnost telefonní a internetové přípojky. Výborná občanská vybavenost - restaurace, bary, kavárny, obchody, galerie, kina, muzea, památky, parky. Bydlení se nachází v blízkosti Karlova náměstí. Výborná dopravní dostupnost, zastávka tramvaje  a stanice metra Karlovo náměstí se nachází 5 minut od domu.

Majitel požaduje vratnou kauci v hodnotě tří měsíčních nájmů."}
